// 质检判定接口
import request from '@/utils/request';
export function getData_a(query) {
  //查询质检判定单列表
  return request({
    url: "/iwms/stores/jqc",
    method: 'get',
    params: query
  });
}
export function update_a(query) {
  //更新入库质检记录
  return request({
    url: "/iwms/stores/jqc/".concat(query.jqcOrderNumber),
    method: 'PATCH',
    data: query
  });
}
export function getData_a_1(query) {
  //查询质检判定单明细列表
  return request({
    url: "/iwms/stores/jqc/".concat(query.jqcOrderNumber, "/items"),
    method: 'GET',
    params: query
  });
}
export function getData_a_2(jqcOrderNumber, jqcRowNo) {
  //查询质检判定明细记录
  return request({
    url: "/iwms/stores/jqc/".concat(jqcOrderNumber, "/items/").concat(jqcRowNo),
    method: 'GET'
  });
}
export function update_a_1(query, temp) {
  //更新入库质检单明细记录
  return request({
    url: "/iwms/stores/jqc/".concat(query.jqcOrderNumber, "/items/").concat(query.jqcRowNo),
    method: 'PATCH',
    data: temp
  });
} //获取区位

export function getArea(warehouseCode) {
  return request({
    url: "/base-modeling/warehouses/".concat(warehouseCode, "/areas"),
    method: 'get'
  });
} //获取储位

export function getLocator(warehouseCode, areaCode) {
  return request({
    url: "/base-modeling/warehouses/".concat(warehouseCode, "/areas/").concat(areaCode, "/locations"),
    method: 'get'
  });
}
export function recommend(query) {
  //库区库位推荐
  return request({
    url: "/iwms/ruleExecution/locationPropose",
    method: 'POST',
    data: query
  });
}
